# name: discourse-narrative-bot
# about: Introduces staff to Discourse
# version: 0.0.1
# authors: Nick Sahler (@nicksahler)

enabled_site_setting :introbot_enabled

after_initialize do
  SeedFu.fixture_paths << Rails.root.join("plugins", "discourse-narrative-bot", "db", "fixtures").to_s

  Mime::Type.register "image/svg+xml", :svg

  load File.expand_path('../jobs/new_user_narrative_input.rb', __FILE__)
  load File.expand_path('../jobs/new_user_narrative_timeout.rb', __FILE__)
  load File.expand_path("../lib/discourse_narrative_bot/new_user_narrative.rb", __FILE__)

  module ::DiscourseNarrativeBot
    PLUGIN_NAME = "discourse-narrative-bot".freeze

    class Engine < ::Rails::Engine
      engine_name PLUGIN_NAME
      isolate_namespace DiscourseNarrativeBot
    end

    class Store
      def self.set(user_id, value)
        ::PluginStore.set(PLUGIN_NAME, key(user_id), value)
      end

      def self.get(user_id)
        ::PluginStore.get(PLUGIN_NAME, key(user_id))
      end

      private

      def self.key(user_id)
        "narrative_state_#{user_id}"
      end
    end

    class CertificatesController < ::ApplicationController
      layout :false
      skip_before_filter :check_xhr

      def generate
        raise Discourse::InvalidParameters.new('name must be present') unless params[:name]
        raise Discourse::InvalidParameters.new('date must be present') unless params[:date]
        raise Discourse::InvalidParameters.new('avatar_url must be present') unless params[:avatar_url]

        width = 538.583 # Default width for the SVG

        begin
          uri = URI(SiteSetting.logo_small_url)

          logo_url
            if uri.host.empty? || uri.scheme.empty?
              "#{Discourse.base_url}/#{uri.path}"
            else
              uri.to_s
            end

          logo_group = <<~URL
          <g transform="translate(#{width / 2 - 20} 280)">
            <image height="40px" width="40px" xlink:href="data:image/png;base64,#{Base64.strict_encode64(uri.open('rb', redirect: true, allow_redirections: :all).read)}"/>
          </g>
          URL
        rescue URI::InvalidURIError
          logo_group = ''
        end

        svg = <<~SVG
